A single Unicode codepoint stored in UTF-32. When concatenated to another character, it forms a string two characters long. Characters can also be concatenated to strings, which just adds the character to the beginning or end of the string. Examples let rainbow = '\u{1f308}';
let zwj = '\u{200d}';
let white_flag = '\u{1f3f3}';
println(rainbow <> zwj <> white_flag); // üåà‚Äçüè≥ (rainbow flag, if your browser doesn't support emoji)

17.body:
A dynamic-length possibly heterogenous sequence. An array is stored contiguously in memory, but it's growable. In Rust, this is implemented using a Vec<T>. Elements are accessed using [E] where E is the zero-indexed element number. Examples let arr = [1, 2, "hello"];
println(arr[2]); // hello
arr = arr <> [5, 2.6, 'a'];
arr = arr <> null;
println(inspect(arr)); // [1, 2, "hello", 5, 2.6, 'a', null]

4.body:
No programming language guide would be complete without a "Hello, world!" example. Code in Calypso is organized in "statements". These are complete lines of code ending with a semicolon. To print text to the console, you call the function println with the string of text you would like to print. To do this, you type the name of the function, followed by an opening parentheses, then the arguments (in this case, a string of text), then a closing parentheses. Enough talk, let's get to the code! Open the REPL and run this: println("Hello, world!"); Calypso requires you to define a main function when you're not running a program in the REPL. This function will always be executed at the beginning of the program. You can define a main function like this: fn main() { println("Hello, world!");
} #[main]
fn main() { println("Hello, world!");
} println("OOPS! This part is invalid code!"); We'll talk about functions, attributes, and all that stuff in more depth in later chapters.

